import { Typography } from "@material-ui/core";
import React from "react";
import BarChart from "./BarChart";
import PieChart from "./PieChart";
import ReactPlayer from "react-player/youtube";
import homeImage from "./images/homeImage.jpg";
import paddle from "./images/paddle.png";
import { homeStyles } from './Home-styles';


export default function Home() {
  let homeImage = document.querySelector('.homeImage');
  let paddle = document.querySelector('.paddle')
  window.addEventListener('scroll', function() {
    var value = window.scrollY;
    paddle.style.top = value * 0,5 + 'px';
    homeImage.style.top = value * 0,15 + 'px';


  })

  const classes = homeStyles();
  return (
    <div>
      <div >
        <div className="section">
          <img src={homeImage} className={classes.homeImage} alt={"homeImage"} width="100%"/>
        </div>
        <div>
          <img src={paddle} className={classes.paddle} alt={"paddle"} width="100%"/>

        </div>
      </div>

      <div
        style={{
          display: "flex",
          width: "100%",
          height: "100%",
          flexFlow: "column",
          alignItems: "center",
        }}
      >
        <Typography h1>Charts</Typography>
        <div
          className="playerContainer"
          style={{ display: "flex", width: "500px" }}
        >
          <ReactPlayer
            url="https://www.youtube.com/watch?v=TAEkR13ChPs"
            stopOnUnmount={false}
            playing="true"
            width="100%"
            height="20em"
          />
        </div>
        <div
          className="ChartsHolder"
          style={{ display: "flex", justifyContent: "space-between" }}
        >
          <div>
            <BarChart />
          </div>
          <div>
            <PieChart />
          </div>
        </div>
      </div>
    </div>
  );
}
